                    in which students are able to reach their full potential. I
                    felt constantly challenged to push myself to exceed what is
                    expected. The person I’ve become is due to my time spent
                    here, and the last six years have been the best of my life."
                  </p>
                  <hr />
                  <h5>Cynthia Nelson</h5>
                  <p>Student of Science</p>
                </div>
                <div className="col-lg-2"></div>
              </div>
            </Carousel.Item>
          </Carousel>
        </div>
      </section>



{/* Testimonials Sections Ends Here */}
